import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, Camera } from 'lucide-react';

const EditProfile = ({ user, setUser }) => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({ ...user });

  const handleSave = () => {
    setUser(formData); // Update global state
    navigate('/profile');
  };

  return (
    <div style={{ padding: '20px' }}>
      <header style={editStyles.header}>
        <ArrowLeft size={24} onClick={() => navigate(-1)} style={{ cursor: 'pointer' }} />
        <h2 style={editStyles.headerTitle}>Edit Profile</h2>
        <div style={{ width: 24 }}></div>
      </header>

      {/* Photo Section */}
      <div style={editStyles.photoSection}>
        <div style={editStyles.avatarContainer}>
          <img 
            src="https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=150" 
            alt="avatar" 
            style={editStyles.avatar} 
          />
          <div style={editStyles.cameraBadge}><Camera size={14} color="#fff" /></div>
        </div>
        <span style={editStyles.changeLink}>Change Profile Photo</span>
      </div>

      {/* Inputs Section */}
      <div style={editStyles.group}>
        <label style={editStyles.label}>Full Name</label>
        <input 
          style={editStyles.input} 
          value={formData.name} 
          onChange={(e) => setFormData({...formData, name: e.target.value})} 
        />
      </div>

      <div style={editStyles.group}>
        <label style={editStyles.label}>College Name</label>
        <input 
          style={editStyles.input} 
          value={formData.college} 
          onChange={(e) => setFormData({...formData, college: e.target.value})} 
        />
      </div>

      <div style={editStyles.group}>
        <label style={editStyles.label}>Register Number</label>
        <input 
          style={editStyles.input} 
          value={formData.regNo} 
          onChange={(e) => setFormData({...formData, regNo: e.target.value})} 
        />
      </div>

      {/* ADDED: Email Address Field */}
      <div style={editStyles.group}>
        <label style={editStyles.label}>Email Address</label>
        <input 
          style={{...editStyles.input, backgroundColor: '#f1f5f9', color: '#64748b'}} 
          value={formData.email} 
          readOnly // Matches design where email is often not directly editable
        />
      </div>

      <button onClick={handleSave} style={editStyles.saveBtn}>Save Changes</button>
      <button onClick={() => navigate(-1)} style={editStyles.cancelBtn}>Cancel</button>
    </div>
  );
};

const editStyles = {
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px' },
  headerTitle: { fontSize: '18px', fontWeight: 'bold', margin: 0 },
  photoSection: { textAlign: 'center', marginBottom: '30px' },
  avatarContainer: { position: 'relative', width: '100px', height: '100px', margin: '0 auto' },
  avatar: { width: '100%', height: '100%', borderRadius: '50%', objectFit: 'cover' },
  cameraBadge: { position: 'absolute', bottom: 0, right: 0, backgroundColor: '#5c5cfc', padding: '6px', borderRadius: '50%', border: '3px solid #fff' },
  changeLink: { color: '#5c5cfc', fontSize: '13px', fontWeight: 'bold', marginTop: '12px', display: 'block' },
  group: { marginBottom: '20px' },
  label: { fontSize: '12px', color: '#94a3b8', marginBottom: '6px', display: 'block' },
  input: { width: '100%', padding: '12px 16px', borderRadius: '12px', border: '1px solid #f1f5f9', backgroundColor: '#f8fafc', boxSizing: 'border-box', outline: 'none' },
  saveBtn: { width: '100%', padding: '14px', backgroundColor: '#5c5cfc', color: '#fff', border: 'none', borderRadius: '12px', fontWeight: 'bold', marginTop: '15px', cursor: 'pointer', boxShadow: '0 4px 6px rgba(92, 92, 252, 0.2)' },
  cancelBtn: { width: '100%', padding: '14px', backgroundColor: 'transparent', color: '#94a3b8', border: 'none', fontWeight: '600', cursor: 'pointer' }
};

export default EditProfile;
